import React from 'react';
import Card from './Card';

const CardList = ({ hbcUsers }) => {
    return (
        <div>
          {
            hbcUsers.map((user, i) => {
              return (
                <div className='bg-green'>
                  <Card
                    email={hbcUsers[i].email}
                    id={hbcUsers[i].guid}
                    key={i}
                    motto={hbcUsers[i].motto}
                    name={hbcUsers[i].name.first + hbcUsers[i].name.last}
                  />
                </div>
              )
            })
          }
        </div>
    );
}

export default CardList;
